INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFIV', 'STOCK', 'F5, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'F5, Inc. É uma empresa de serviços e segurança de aplicativos multinuvem. A empresa faz parceria com várias organizações para proteger e otimizar cada interface de programação de aplicativos e aplicativos (API) em qualquer lugar - no local, na nuvem ou na borda. Os serviços de aplicativos de nível empresarial da empresa estão disponíveis como soluções baseadas em nuvem, software como serviço e somente software otimizadas para ambientes de várias nuvens, com módulos que podem ser executados independentemente ou como parte de uma solução integrada em seus dispositivos de alto desempenho. A empresa, por meio de seu produto Big IP, F5 NGINX e F5 Distributed Cloud Services, oferece uma gama de soluções integradas, baseadas em inteligência artificial e aprendizado de máquina que suportam o desempenho e protegem aplicativos e APIs legados e modernos em locais de data center, nuvem e borda. Seus produtos e soluções incluem F5 Distributed Cloud Web App e API Protection, F5 NGINX Ingress Control', 'Seattle, WA, United States', 6159);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTB', 'STOCK', 'Connect Biopharma Holdings Limited', 'NGM', 'Healthcare', 'Biotechnology', 'Connect Biopharma Holdings Limited is a global clinical-stage biopharmaceutical company. The Company is focused on advancing rademikibart, a potentially best-in-class next generation anti-interleukin-4-receptor alpha (IL-4R?) antibody, to transform acute and chronic care in asthma and chronic obstructive pulmonary disease (COPD). Its lead product candidate, rademikibart, is an antibody designed to target interleukin-4 receptor alpha (IL-4R?) in development for the treatment of atopic dermatitis (AD) and asthma. As an inhibitor of IL-4R?, rademikibart blocks inflammatory signaling by both IL-4 and IL-13. The Company has completed a global Phase II trial (CBP-201-WW001) of rademikibart in adult patients with moderate-to-severe AD.', 'San Diego, CA, United States', 62);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCH', 'STOCK', 'Banco de Chile', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco de Chile is a full service financial institution, which is engaged in providing credit and non-credit products and services in Chile. The Bank offers a range of banking services to its customers, ranging from individuals to corporations. The Bank''s segments include Retail, which focuses on individuals and small and medium-sized companies, where the product offering focuses on consumer loans, commercial loans, checking accounts, credit cards, credit lines and mortgage loans; Wholesale, which focuses on corporate clients and companies, where the product offering focuses on commercial loans, checking accounts and liquidity management services, debt instruments, foreign trade, derivative contracts and leases; Treasury, which includes the associated revenues to the management of the investment portfolio and the business of financial transactions and currency trading, and Subsidiaries, which corresponds to companies and corporations controlled by the Bank.', 'Santiago de Chile, , Chile', 11614);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDRX', 'STOCK', 'Biodexa Pharmaceuticals Plc', 'NCM', 'Healthcare', 'Biotechnology', 'Biodexa Pharmaceuticals PLC is a clinical-stage biopharmaceutical company. The Company is developing a pipeline of products for the treatment of diseases with unmet medical needs. The Companys lead development program, eRapa, is under development for familial adenomatous polyposis and non-muscle invasive bladder cancer; tolimidone, under development as a for the treatment of type 1 diabetes; and MTX110, which is being studied in aggressive rare/orphan brain cancer indications, including recurrent glioblastoma, diffuse midline glioma, or DMG, and medulloblastoma. Its technologies include Q-Sphera, MidaCore and MidaSolve. The Q-Sphera platform is a polymer microsphere microtechnology used for sustained delivery to prolong and control the release of therapeutics over an extended period of time, from weeks to months. Its MidaSolve platform is an oligosaccharide nanotechnology that is used to solubilize drugs so that they can be administered in liquid form directly and locally into tumors.', 'Cardiff, , United Kingdom', 13);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMP', 'STOCK', 'Ameriprise Financial, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Ameriprise Financial, Inc. É uma empresa diversificada de serviços financeiros. Os segmentos da empresa incluem Consultoria e Gestão de Riqueza, Gestão de Ativos, Soluções de Retirement & Protection e Corporate & Other. O segmento Advice & Wealth Management fornece planejamento financeiro e consultoria, bem como serviços de corretagem de serviço completo, principalmente para clientes de varejo através dos consultores da Companhia. O segmento Asset Management fornece gerenciamento de investimentos, consultoria e produtos para clientes de varejo, alto patrimônio líquido e institucionais em escala global através da marca Columbia Threadneedle Investments. Fornece produtos e serviços institucionais através de sua força de vendas institucional. O segmento de Soluções de Aposentadoria e Proteção inclui soluções de aposentadoria (anuidades variáveis e anuidades de pagamento) e soluções de proteção (seguro de renda de vida e invalidez). A Retirement Solutions fornece produtos de anuidade variá', 'Minneapolis, MN, United States', 13600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTC', 'STOCK', 'EVERTEC, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'EVERTEC, Inc. É uma empresa de processamento de transações. A Empresa fornece uma gama de serviços de aquisição, processamento de pagamentos e gestão de processos de negócios. A Companhia atua através de três segmentos: Aquisição de Comerciantes, Processamento de Pagamentos e Soluções Empresariais. A partir de 31 de dezembro de 2016, gerenciou um sistema de redes de pagamento eletrônico que processou mais de dois bilhões de transações anualmente. Ele oferece uma gama de serviços para processamento de banco central, processamento de caixa e terceirização de tecnologia. Possui e opera a rede ATH, que é uma rede de débito com número de identificação pessoal (PIN) na América Latina. Ele atende a uma variedade de instituições financeiras, comerciantes, corporações e agências governamentais com soluções que lhes permitem emitir, processar e aceitar transações de forma segura. A gama de serviços da Empresa abrange toda a cadeia de valor de processamento de transações e inclui uma gama de solu', 'San Juan, PR, United States', 4800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNNE', 'STOCK', 'Cannae Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Cannae Holdings, Inc. primarily acquires interests in operating companies and is actively engaged in managing and operating a core group of those companies. Its segments include Restaurant Group, Alight, Black Knight Football and Entertainment (BKFE). The Restaurant Group segment consists of the operations of O''Charley''s and 99 Restaurants, in which it has 65.4% and 88.5% ownership interests, respectively. The Alight segment consists of its 7.6% ownership interest in Alight, which is a technology-enabled services company delivering human capital management solutions to many organizations. This includes the implementation and administration of employee benefits (health, wealth and leaves benefits) solutions. The Black Knight Football and Entertainment segment consists of its 47.2% ownership interest in BKFC, which owns and operates AFC Bournemouth, and a significant minority interest in FC Lorient, a French Ligue 1 football club.', 'Las Vegas, NV, United States', 7317);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long ARM Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSM', 'STOCK', 'Black Stone Minerals, L.P.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Black Stone Minerals, L.P., together with its subsidiaries, owns and manages oil and natural gas mineral interests. It owns mineral interests in approximately 16.8 million gross acres, nonparticipating royalty interests in 1.8 million gross acres, and overriding royalty interests in 1.6 million gross acres located in 41 states in the United States. The company was founded in 1876 and is based in Houston, Texas.', 'Houston, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSGX', 'STOCK', 'The Descartes Systems Group Inc.', 'NMS', 'Technology', 'Software - Application', 'The Descartes Systems Group Inc. is focused on logistics and supply chain management business processes. It provides on-demand, software-as-a-service (SaaS) solutions focused on improving the productivity, security and sustainability of logistics-intensive businesses. It allows customers to use its modular, SaaS solutions to route, track and help improve the safety, compliance of delivery resources; plan, allocate and execute shipments; rate, audit and pay transportation invoices; access global trade data; file customs and security documents for imports and exports; and complete other logistics processes by participating in the multimodal logistics community. Its solutions include cloud-based and consist of B2B service connectivity and messaging, broker and forwarder enterprise systems, global trade intelligence, regulatory compliance, e-commerce shipping, transportation management and routing. It also provides customs declaration software for logistics services providers and shippers.', 'Waterloo, ON, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBRL', 'STOCK', 'Cracker Barrel Old Country Store, Inc.', 'NMS', 'Consumer Cyclical', 'Restaurants', 'Cracker Barrel Old Country Store, Inc. is engaged in the operation and development of the Cracker Barrel Old Country Store concept (Cracker Barrel). It operates 658 Cracker Barrel stores in 44 states and 68 Maple Street Biscuit Company stores in 10 states. The Companys format of its stores consists of a trademarked rustic old country-store design offering a full-service restaurant menu that features home-style country food and a wide variety of decorative and functional items such as rocking chairs, holiday and seasonal gifts, toys, apparel, cookware and foods. Its restaurants serve breakfast, lunch and dinner daily and offer dine-in, pick-up and delivery services. Its breakfast items include juices, eggs, pancakes, meats, grits, and a variety of biscuit specialties, such as gravy and biscuits and country ham and biscuits. Its Lunch and dinner items include fried and grilled chicken, chicken and dumplings, chicken pot pie, meatloaf, country fried steak, pork chops, fish, and more.', 'Lebanon, TN, United States', 77600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTX', 'STOCK', 'BlackRock Innovation and Growth Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Technology and Private Equity Term Trust is a mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. BlackRock Technology and Private Equity Term Trust is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNVS', 'STOCK', 'Cineverse Corp.', 'NCM', 'Communication Services', 'Entertainment', 'Cineverse Corp. is a global streaming technology and entertainment company. The Company''s business is operating as a portfolio of owned and operated streaming channels; a global aggregator and full-service distributor of feature films and television programs, and a technology software-as-a-service platform for over-the-top app development and content distribution through subscription video on demand (SVOD), dedicated ad-supported (AVOD), ad-supported streaming linear (FAST) channels, social video streaming services, and audio podcasts. Its streaming channels reach audiences in several distinct ways: direct-to-consumer, through these major application platforms, and through third party distributors of content on platforms. The Company''s streaming technology platform, known as Matchpoint, is a software-based streaming operating platform which provides clients with AVOD, SVOD, transactional video on demand (TVOD) and linear capabilities, automates the distribution of content, and others', 'New York, NY, United States', 213);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCU', 'STOCK', 'Invesco BulletShares 2030 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2030. It does not purchase all of the securities in the index; instead, the fund utilizes a "sampling" methodology to seek to achieve its investment objective.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('QVCGA', 'STOCK', 'QVC Group Inc.', 'NCM', 'Consumer Cyclical', 'Internet Retail', 'QVC Group, Inc., formerly Qurate Retail, Inc., is a live social shopping company that redefines the shopping experience through video-driven commerce on every screen, from smartphones and tablets to laptops and televisions. The Company''s retail brands include QVC, HSN, Ballard Designs, Frontgate, Garnet Hill and Grandin Road. The Company reaches more than 200 million homes worldwide via 15 television channels, which are available on cable/satellite television, free over-the-air television, and FAST and other digital livestreaming television. It also reaches millions of customers via its QVC+ and HSN+ streaming experience, Facebook, Instagram, TikTok, YouTube, Pinterest, websites, mobile apps, print catalogs, and in-store destinations. It also holds various minority interests.', 'Englewood, CO, United States', 18984);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CETY', 'STOCK', 'Clean Energy Technologies, Inc.', 'NCM', 'Industrials', 'Specialty Industrial Machinery', 'Clean Energy Technologies Inc. is a clean energy technology company offering eco-friendly green energy solutions, clean energy fuels and alternative electric power for small and mid-sized projects in North America, Europe, and Asia. The Companys segments include Clean Energy HRS & CETY Europe, CETY Renewables Waste to Energy Solutions, Engineering and Manufacturing Business and CETY HK. The Clean Energy HRS & CETY Europe segment provides waste heat recovery solutions, converting thermal energy to zero-emission electricity. The CETY Renewables Waste to Energy Solutions segment offers waste to energy technologies and solutions. The Engineering and Manufacturing Business provides customers with comprehensive design, manufacturing, and project management solutions. CETY HK is the parent company of its natural gas (NG) trading operations in China. Its principal products are Waste Heat Recovery Solutions, using its patented Clean Cycle generator to create electricity.', 'Irvine, CA, United States', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIB', 'STOCK', 'Grupo Cibest S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'A Bancolombia S.A. (Bancolombia) é uma instituição financeira que oferece uma variedade de produtos e serviços financeiros para uma base diversificada de clientes individuais, corporativos e governamentais em toda a Colômbia, América Latina e região do Caribe. O Banco opera através de 10 segmentos: Banking Colombia, Banking Panama, Banking El Salvador, Arrendamento, Fiduciário, Banco de Investimentos, Corretagem, Off Shore e Todo o resto. Fornece seus produtos e serviços por meio de sua rede regional que compreende a rede bancária não governamental da Colômbia, o conglomerado financeiro de El Salvador por empréstimos brutos, o banco da Guatemala, o banco do Panamá e subsidiárias bancárias off-shore no Panamá, Cayman e Porto Rico, bem como subsidiárias no Peru. O Banco e suas subsidiárias oferecem Poupança e Investimento, Ahorro A La Mano, Financiamento, Banco Hipotecário, Factoring, Arrendamento Financeiro e Operacional, Mercado de Capitais, eTrading, Gerenciamento de Dinheiro, Moeda E', 'Medellín, , Colombia', 33993);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATO', 'STOCK', 'Atmos Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'A Atmos Energy Corporation é um distribuidor exclusivo de gás natural. A empresa entrega gás natural a mais de 3,3 milhões de clientes de distribuição em mais de 1 400 comunidades em oito estados localizados principalmente no Sul. Ele gerencia ativos proprietários de dutos e armazenamento, incluindo sistemas de gasodutos intraestatais no Texas. Seus segmentos incluem distribuição e pipeline e armazenamento. O segmento de distribuição compreende sua distribuição regulamentada de gás natural e operações de vendas relacionadas em oito estados. O segmento de gasoduto e armazenamento é composto por operações de gasoduto e armazenamento reguladas de sua divisão Atmos Pipeline-Texas (APT) e suas operações de transmissão de gás natural na Louisiana. O APT é uma operação de gasoduto intraestatal no Texas com uma forte concentração nas áreas estabelecidas produtoras de gás natural do Texas central, norte e leste, estendendo-se para ou perto das principais áreas produtoras do xisto Barnet, da Cos', 'Dallas, TX, United States', 5260);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATMU', 'STOCK', 'Atmus Filtration Technologies Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Atmus Filtration Technologies Inc. is engaged in filtration and media solutions. The Company designs and manufactures advanced filtration products, principally under the Fleetguard brand, that enable lower emissions and provide superior asset protection. It serves customers across the truck, bus, agriculture, construction, mining, marine and power generation vehicle, and equipment markets, along with providing comprehensive aftermarket support and solutions. Its products include fuel filters, lube filters, air filters, crankcase ventilation, hydraulic filters and coolants and other chemicals. It offers products for first fit and aftermarket applications to original equipment manufacturers, dealers/distributors, and end-users. The Company produces and sells Fleetguard branded products across North America, Europe, South America, Asia, Australia, and the African continents. Its Fleetguard branded products are available through distribution centers worldwide.', 'Nashville, TN, United States', 4500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNED', 'STOCK', 'Barnes & Noble Education, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'Barnes & Noble Education, Inc. is a contract operator of physical and virtual bookstores for college and university campuses and K-12 institutions across the United States. The Company also textbook wholesalers and inventory management hardware and software providers. The Company operates through two segments: Retail, and Wholesale. The Retail Segment operates 1,245 college, university, and K-12 school bookstores, comprised of 707 physical bookstores and 538 virtual bookstores. The Wholesale Segment provided a comprehensive selection of new and used textbooks to approximately 2,750 physical bookstores, including its Retail segment''s 707 physical bookstores and sources, and distributes new and used textbooks to its 538 virtual bookstores. Additionally, the Wholesale Segment sells hardware and a software suite of applications that provides inventory management and point-of-sale solutions to approximately 325 college bookstores.', 'Basking Ridge, NJ, United States', 2520);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWT', 'STOCK', 'California Water Service Group', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'California Water Service Group is a holding company that provides water utility and other related services in California, Washington, New Mexico, Hawaii and Texas through its subsidiaries. Its business is conducted through its operating subsidiaries and provides utility services. Its business consists of the production, purchase, storage, treatment, testing, distribution, and sale of water for domestic, industrial, public, and irrigation uses, and the provision of domestic and municipal fire protection services. It provides wastewater collection and treatment services, including treatment which allows water recycling. It also provides non-regulated water-related services under agreements with municipalities and other private companies. The non-regulated services include full water system operation, meter reading, and billing services. Non-regulated operations also include the lease of communication antenna sites, lab services and promotion of other non-regulated services.', 'San Jose, CA, United States', 1278);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKU', 'STOCK', 'BankUnited, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'BankUnited, Inc. is a bank holding company of BankUnited (the Bank). The Bank provides a full range of commercial lending and both commercial and consumer deposit services through banking centers located in Florida, the New York metropolitan area and Dallas, Texas, and a comprehensive suite of wholesale products to customers through an Atlanta office focused on the Southeast region. The Banks lending products include commercial loans, commercial real estate loans, residential mortgages and other consumer loans. It offers traditional deposit products including commercial and consumer checking accounts, money market deposit accounts, savings accounts and certificates of deposit with a variety of terms and rates, as well as a robust suite of treasury, payments and cash management services. The Bank provides certain commercial lending and deposit products through national platforms and certain consumer deposit products through an online channel.', 'Miami Lakes, FL, United States', 1662);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACM', 'STOCK', 'AECOM', 'NYQ', 'Industrials', 'Engineering & Construction', 'AECOM is a global provider of professional infrastructure consulting and advisory services for governments, businesses and organizations throughout the world. It provides advisory, planning, consulting, architectural and engineering design, construction and program management services, and investment and development services to public and private clients worldwide in major end markets, such as transportation, facilities, water, environmental, and energy. Its Americas segment provides planning, consulting, architectural and engineering design, construction management and program management services to public and private clients in the United States, Canada, and Latin America. Its International segment provides planning, consulting, architectural and engineering design services and program management to public and private clients in Europe, the Middle East, India, Africa, and the Asia-Australia-Pacific regions. Its ACAP segment primarily invests in and develops real estate projects.', 'Dallas, TX, United States', 51000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVL', 'STOCK', 'Direxion Daily AVGO Bull 2X Shares', 'NGM', NULL, NULL, 'Australian Vanadium Limited is engaged in the advancement of the Australian Vanadium Project, exploration for vanadium/titanium and other economic resources, development of vanadium electrolyte production and the sale of vanadium flow batteries (VFB) systems. The Exploration segment includes Australian Vanadium Project and other exploration projects. The Energy storage segment include VSUN Energy Pty Limited''s vanadium redox flow battery marketing and sales activities. The Electrolyte Plant segment is its vanadium electrolyte manufacturing facility in Western Australia. The Australian Vanadium Project consists of V-Ti-Fe deposit located in the Murchison Province 43 kilometers (kms) south of the mining town of Meekatharra in Western Australia and 740 km north-east of Perth. The Project consists of 15 tenements covering 200 square km. The Coates Project is located in the Shire of Northam, approximately 60 km east of Perth. The Nowthanna Hill deposit is located 50 km south of Meekatharra', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTS', 'STOCK', 'ALT5 Sigma Corporation', 'NCM', 'Technology', 'Software - Application', 'ALT5 Sigma Corporation is a fintech company providing blockchain-powered technologies for tokenization, trading, clearing settlement, payment and safe keeping of digital assets. The Company, through its subsidiary, ALT5 Sigma, Inc., provides blockchain-powered technologies to enable migration to a global financial paradigm. It offers two platforms to its customers: ALT5 Pay and ALT5 Prime. ALT5 Pay is a cryptocurrency payment gateway that enables registered and approved global merchants to accept and make cryptocurrency payments or to integrate the ALT5 Pay payment platform into their application or operations using the plugin with WooCommerce and or ALT5 Pay''s checkout widgets and APIs. ALT5 Prime is an electronic over-the-counter trading platform that enables registered and approved customers to buy and sell digital assets. The Company also owns Mswipe, which is a payment solutions provider offering multi-currency, fiat payment card services along with crypto-enabled capabilities.', 'Las Vegas, NV, United States', 10);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTAI', 'STOCK', 'BioXcel Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioXcel Therapeutics, Inc. is a biopharmaceutical company utilizing artificial intelligence to develop medicines in neuroscience. Its subsidiary, OnkosXcel Therapeutics LLC, is focused on the development of medicines in immuno-oncology. Its advanced neuroscience candidate, BXCL501, is an investigational, orally dissolving film formulation of dexmedetomidine in development for the treatment of agitation associated with psychiatric and neurological disorders. It is continuing to develop BXCL501 for the potential acute treatment of agitation associated with bipolar disorder or schizophrenia in the at-home setting and for the potential acute treatment of agitation (non-daily) associated with dementia due to probable Alzheimers disease in the at-home setting and in care facilities. Its advanced immuno-oncology candidate, BXCL701, is an investigational oral innate immune activator for the treatment of aggressive forms of prostate cancer, pancreatic cancer, and other solid and liquid tumors.', 'New Haven, CT, United States', 37);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACLX', 'STOCK', 'Arcellx, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Arcellx Inc. is a clinical-stage biotechnology company reimagining cell therapy by engineering immunotherapies for patients with cancer and other incurable diseases. Its lead program is a BCMA-targeting ddCAR product candidate called anitocabtagene autoleucel, which is being evaluated in its pivotal Phase II iMMagine-1 and the Phase III iMMagine-3 trials in patients with relapsed or refractory multiple myeloma (rrMM). Anitocabtagene is the first BCMA-directed CAR T-cell therapy to be investigated in multiple myeloma that utilizes its novel and compact binder known as the D-Domain. The small, stable D-Domain binder enables high CAR expression without tonic signaling and is designed to quickly release from the BCMA target. It is also developing two clinical-stage ARC-SparX programs in Phase I trials: ACLX-001, which targets BCMA in rrMM, and ACLX-002, which targets CD123 in relapsed or refractory acute myeloid leukemia (AML) and high-risk myelodysplastic syndrome (MDS).', 'Redwood City, CA, United States', 163);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLYM', 'STOCK', 'Climb Bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Climb Bio, Inc. is a clinical-stage biotechnology company. The Company is focused on developing therapeutics for patients with immune-mediated diseases. The Companys lead product candidate, budoprutug, is an anti-CD19 monoclonal antibody designed to deplete CD19-positive B cells, including antibody-secreting cells, in order to directly reduce pathogenic autoantibodies. The reduction of autoantibodies has the potential to be disease-modifying in autoantibody-driven diseases, such as systemic lupus erythematosus, immune thrombocytopenia, and membranous nephropathy. The budoprutug is in a Phase Ib/IIa clinical trial. The Company is also developing CLYM116, an anti-APRIL antibody, in investigational new drug applications (IND)-enabling studies for IgA nephropathy (IgAN).', 'Wellesley Hills, MA, United States', 17);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVA', 'STOCK', 'Avista Corporation', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Avista Corp. is an energy company involved in the production, transmission and distribution of energy as well as other energy-related businesses. Its segment includes Avista Utilities and AEL&P. The Avista Utilities segment comprises regulated utility operations in Washington, Idaho, Oregon and Montana. It engages in electric distribution and transmission, and natural gas distribution services in parts of eastern Washington and northern Idaho. It also provides natural gas distribution service in parts of northeastern and southwestern Oregon. Additionally, it supplies electricity to a small number of customers in Montana. Avista Utilities also engages in wholesale purchases and sales of electricity and natural gas as an integral part of energy resource management and its load-serving obligation. The AEL&P segment is a regulated utility providing electric services in Juneau, Alaska that is a wholly owned subsidiary and the primary operating subsidiary of AERC.', 'Spokane, WA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMTG', 'STOCK', 'Claros Mortgage Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Claros Mortgage Trust, Inc. is a real estate investment trust. The Company is focused primarily on originating senior and subordinate loans on transitional commercial real estate (CRE) assets located in markets across the United Sates. Its objective is to provide debt capital for transitional CRE assets and, in doing so, to generate risk-adjusted returns for its stockholders. It seeks primarily to originate, co-originate and acquire senior and subordinate loans on transitional CRE assets located in the United States markets and generally intend to hold its loans to maturity. In addition to its primary focus on the United States markets, it also seeks to originate senior and subordinate loans on transitional CRE assets located in other markets. It also focuses on mortgage loans secured by a first priority or subordinate mortgage on transitional CRE assets, and subordinate loans, including mezzanine loans. The Company is externally managed and advised by Claros REIT Management LP.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGIO', 'STOCK', 'Agios Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Agios Pharmaceuticals, Inc. is a biopharmaceutical company. The Company is focused on developing and delivering transformative therapies for patients living with rare diseases. It markets a first-in-class pyruvate kinase (PK) activator for adults with PK deficiency, the first disease-modifying therapy for debilitating hemolytic anemia. Its lead product candidate in its portfolio, PYRUKYND (mitapivat), is an activator of both wild-type and mutant pyruvate kinase, or PK, enzymes for the potential treatment of hemolytic anemias. It is also developing tebapivat, a novel PK activator, for the potential treatment of lower-risk myelodysplastic syndromes, or LR MDS, and hemolytic anemias; AG-181, its phenylalanine hydroxylase, or PAH, stabilizer for the potential treatment of phenylketonuria, or PKU; and AG-236, an siRNA in-licensed from Alnylam Pharmaceuticals, Inc., targeting the transmembrane serine protease 6, or TMPRSS6 gene for the potential treatment of polycythemia vera, or PV.', 'Cambridge, MA, United States', 486);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBI', 'STOCK', 'Designer Brands Inc.', 'NYQ', 'Consumer Cyclical', 'Footwear & Accessories', 'Designer Brands Inc. is a designer, producer and retailer of footwear brands and accessories. The Company operates through three segments: the U.S. Retail segment, the Canada Retail segment, and the Brand Portfolio segment. The U.S. Retail segment operates the DSW Designer Shoe Warehouse (DSW) banner through its direct-to-consumer United States stores and e-commerce site. The Canada Retail segment operates The Shoe Company, DSW, and Rubino banners through its direct-to-consumer stores and e-commerce sites in Canada. The Brand Portfolio segment is engaged in the wholesale of its branded products to retailers and international distributors; commissions for serving retailers as the design and buying agent for products under private labels; and the sale of its Vince Camuto, Keds, and Topo brands through direct-to-consumer e-commerce sites. The Company operates approximately 494 stores in the United States and 175 stores in Canada.', 'Columbus, OH, United States', 14000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APPF', 'STOCK', 'AppFolio, Inc.', 'NGM', 'Technology', 'Software - Application', 'AppFolio, Inc. is a technology company focusing on the real estate industry. It provides a cloud-based platform on which its customers operate their businesses. It also provides key functionality related to critical transactions across the real estate lifecycle, including screening potential residents, sending and receiving payments, and providing insurance-related risk mitigation services. Its platform is AppFolio Realm, a suite of AI-powered tools that assist with leasing, maintenance, accounting, and other business-critical tasks. AppFolio Realm includes generative AI to answer questions, perform tasks and automate common workflows. The platform also includes Stack, its partner ecosystem that allows customers to connect its platform with specialized technology and services offered by third parties. Its platform is offered as a service and made available via three subscription plans: AppFolio Property Manager Core, AppFolio Property Manager Plus, and AppFolio Property Manager Max.', 'Santa Barbara, CA, United States', 1634);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUO', 'STOCK', 'Fangdd Network Group Ltd.', 'NCM', 'Real Estate', 'Real Estate Services', 'Fangdd Network Group Ltd is a company that mainly engaged in providing solutions for real estate brokers through online real estate trading platform SaaS. SaaS-based solutions connect real estate agents with essential business resources, including customers, property listings, capital and transaction data. The platform matches agents with the listings as well as buyers, sellers, landlords, renters. The Company operates its businesses primarily in the China market.', 'Shenzhen, , China', 134);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASGN', 'STOCK', 'ASGN Incorporated', 'NYQ', 'Technology', 'Information Technology Services', 'ASGN Incorporated is a provider of information technology (IT) services and solutions to the commercial and government sectors. The Company operates through two segments: Commercial and Federal Government. The Commercial segment provides a spectrum of IT services and solutions to Fortune 1000 and large mid-market clients. Growth in this segment is being driven by digital transformation and innovation requirements, including that of AI, workforce mobilization, and modern enterprise needs across five industry verticals: Financial Services, Consumer and Industrial, Technology, Media, and Telecom, Healthcare, and Business and Government Services. The Federal Government segment delivers advanced solutions in cloud and enterprise IT, cybersecurity, AI/ML, application, and digital transformation to agencies in both the public and private sectors. The segment provides services under time-and-materials, cost-reimbursable, and firm-fixed-price contracts.', 'Glen Allen, VA, United States', 3200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAE', 'STOCK', 'CAE Inc.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'CAE Inc. is a technology company. It operates in two segments: Civil Aviation and Defense and Security. The Civil Aviation training segment provides comprehensive training solutions for flight, cabin, maintenance and ground personnel in commercial, business and helicopter aviation, a complete range of flight simulation training devices, ab initio pilot training and crew sourcing services, as well as aircraft flight operations solutions. It manages approximately 324 full-flight simulators. Its training systems includes CAE Real-time Insights and Standardized Evaluations (CAE Rise), which improves training through the integration of untapped flight and simulator data-driven insights into training. The Defense and Security segment provides platform-independent training and simulation solutions, preparing global defense and security forces for the mission ahead. In addition to solutions delivered to customer sites, it provides comprehensive training at its CAE global training centers.', 'Saint-Laurent, QC, Canada', 13000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHF', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The Companys segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXSM', 'STOCK', 'Axsome Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Axsome Therapeutics, Inc. is a biopharmaceutical company. The Company is focused on the development and commercialization of medicines for people living with central nervous system (CNS) conditions. The Company''s commercial products include Auvelity, Sunosi and Symbravo. It is also advancing a diversified, late-stage pipeline of product candidates for serious neurological and psychiatric conditions, which include AXS-05, Solriamfetol, AXS-12 and AXS-14. Auvelity (dextromethorphan-bupropion) is an oral, N-methyl-D-aspartate (NMDA) receptor antagonist with multimodal activity indicated for the treatment of major depressive disorder (MDD). Sunosi (solriamfetol) is an oral medication indicated for the treatment of excessive daytime sleepiness (EDS), in patients with narcolepsy or obstructive sleep apnea. Symbravo (meloxicam and rizatriptan, 20 mg/10mg tablets) is an oral, single-dose medicine approved for the acute treatment of migraine with or without aura in adults.', 'New York, NY, United States', 846);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCI', 'STOCK', 'Donaldson Company, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Donaldson Company, Inc. specializes in technology-led filtration products and solutions, serving a range of industries and advanced markets. The Company''s segments include Mobile Solutions, Industrial Solutions and Life Sciences. Mobile Solutions segment is organized based on a combination of customers and products and consists of the off-road, on-road and aftermarket business units. Its products consist of replacement filters for both air and liquid filtration applications and filtration housings for new equipment production and systems related to exhaust and emissions. Industrial Solutions segment is organized based on product type and consists of industrial air filtration, industrial gasses, industrial hydraulics, power generation and aerospace and defense products. Life Sciences segment is organized by end market and consists of the bioprocessing equipment and consumables, food and beverage, vehicle electrification and medical device, microelectronics and disk drive markets.', 'Bloomington, MN, United States', 14000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUBI', 'STOCK', 'Customers Bancorp, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Customers Bancorp, Inc. is a bank holding company engaged in banking activities through its wholly owned subsidiary, Customers Bank (the Bank). The Bank provides banking products, primarily loans and deposits, to businesses and consumers through its branches, limited production offices and administrative offices in Berks County and Southeastern Pennsylvania, New York, Hamilton, New Jersey, Massachusetts, and other locations. It also administratively supports loans and other financial products, including equipment finance leases, to customers. It also serves specialized businesses nationwide, including its mortgage finance loans, commercial equipment financing, SBA lending, specialized lending and consumer loans through relationships with fintech companies. It also offers digital banking to commercial and consumer businesses nationwide. Its specialized lending includes fund finance, real estate specialty finance, technology and venture, healthcare and financial institutions groups.', 'West Reading, PA, United States', 809);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZH', 'STOCK', 'Beazer Homes USA, Inc.', 'NYQ', 'Consumer Cyclical', 'Residential Construction', 'Beazer Homes USA, Inc. is a geographically diversified homebuilder with active operations in approximately 13 states. It operates in three segments: West, East, and Southeast. The West segment includes Arizona, California, Nevada, and Texas. The East segment includes Delaware, Indiana, Maryland, New Jersey(a), Tennessee, and Virginia. The Southeast segment includes Florida, Georgia, North Carolina, and South Carolina. Its portfolio includes Montana Vista, Retreat at Rancho Mirage, Acacia Foothills at Estrella, Highpointe at Northpointe, Marbella at Windrose, Tirreno at IronWing, Cassia at Vistancia, Bethany Grove, Sanctuary, and Willows at Bella Vista Farms. It builds its homes in Arizona, California, Delaware, Florida, Georgia, Indiana, Maryland, Nevada, North Carolina, South Carolina, Tennessee, Texas, and Virginia. The Company with its Choice Plans, consumers can personalize primary living areas, giving you a choice of how you want to live in the home, at no additional cost.', 'Atlanta, GA, United States', 1158);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXON', 'STOCK', 'Axon Enterprise, Inc.', 'NMS', 'Industrials', 'Aerospace & Defense', 'A Axon Enterprise, Inc. É fornecedora de soluções de tecnologia de aplicação da lei. A empresa está envolvida na construção do sistema operacional de segurança pública, integrando dispositivos de hardware e soluções de software em nuvem que lideram o policiamento, defesa e segurança modernos. Seu ecossistema inclui dispositivos de energia TASER, câmeras usadas no corpo, câmeras no carro, soluções de gerenciamento de evidências digitais hospedadas na nuvem, software de produtividade, recursos de operações em tempo real e integrações de terceiros por meio de sua rede de parceiros. O segmento TASER da Companhia oferece fabricação e venda de dispositivos elétricos conduzidos, baterias, acessórios, garantias estendidas e outros produtos e serviços. Desenvolvimento, fabricação e venda de soluções de hardware e software totalmente integradas e baseadas em nuvem que permitem que as autoridades policiais capturem, armazenem, gerenciem, compartilhem e analisem vídeo e outras evidências digitais.', 'Scottsdale, AZ, United States', 4100);\n
